import './App.css';
import React, { Component } from 'react';
import { Popover, Menu, Avatar, Layout } from 'antd';

function App() {
  const { Header } = Layout;
  const content = (
      <div>
        <p onClick={logout} className='logout-action'><strong>Logout</strong></p>
      </div>
  );
  return (
      <Layout>
        <Header style={{ position: 'fixed', zIndex: 1, width: '100%' }}>
          <div className="nav-bar">
            <div className="logo-img">
            FACEBOOK
            </div>
            <Popover placement="topRight" content={content}>
              <div className='profile-setting'>
                  <span className="user-name">
                    Logeshwaran
                  </span>
                <Avatar className="user-img" src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
              </div>
            </Popover>
          </div>
        </Header>
      </Layout>
  );
}

export default App;
